angular.module("n").run(["$templateCache",function(e){e.put("app/views/frontpage.html",'<div class="container"><div class="portugal"><div class="dropdown"><ul class="dropdown-sources" list=""><li ng-repeat="source in sources"><a href="" ng-click="fetchSource(source)"><strong>{{ source.name }}</strong></a></li></ul></div><ul class="news"><li ng-repeat="article in news" ng-if="article.content | trim"><article><a href="{{ article.link }}" target="_blank" title="{{ article.title }}"><h2>{{ article.title }}</h2></a> <span class="date">{{ article.publishedDate }}</span><p class="copy">{{ article.content | trim }}</p></article></li></ul></div></div>')}]);